import Head from "next/head";
import Navbar from "./Navbar";
import { Container, Row } from "react-bootstrap";

const Layout = (props) => (
  <div>
    <Head>
      <title>Demo App</title>
    </Head>
    <Container fluid="md">
      <Row>
        <Col>1 of 1</Col>
      </Row>
    </Container>
    <Navbar />
    <div className="container">{props.children}</div>
  </div>
);

export default Layout;
